import React from "react";
import Head from "next/head";
const List = props => {
  return (
    <div>
      <ul class="list-group">
        {props.items.map((item, index) => (
          <li
            class="list-group-item d-flex justify-content-between align-items-center"
            key={index}
          >
            <span class="badge badge-primary badge-pill">delete</span>
            {item}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default List;
